import { EnvConfig } from "./EnvConfig";
import { EnvConstants } from "./EnvConstants";
import { ApiConfig, NavbarConfig } from ".";
import { AppConfig } from "./AppConfig";

export function getDefaultNavbarConfig(): NavbarConfig {
  return {
    // logo: {
    //   link: {
    //     href: "/discover",
    //     title: "PiX Discover",
    //   },
    // },
    menu: {
      items: [
        {
          key: "communities",
          href: "/portal/coi",
          text: "Communities",
        },
        {
          key: "portals",
          href: "/portal",
          text: "Portals",
        },
        {
          key: "rfis",
          href: "/rfi",
          text: "RFIs",
        },
        {
          key: "invite-user",
          href: "/invitations/invite",
          text: "Invite New User",
        },
        {
          key: "external-applications",
          text: "Partner Applications",
          // Partner apps are set per environment.
          // items: [],
        },
      ],
    }
  }
}
